void InitializeEmbeddedResources()
{
    // Helper lambda to add image from memory
    auto addImageFromMemory = [](const wxString& name, const unsigned char* data, size_t size, wxBitmapType type) {
        wxMemoryInputStream stream(data, size);
        wxImage img(stream, type);
        if (img.IsOk())
            wxMemoryFSHandler::AddFile(name, img, type);
    };

    // Add icon directly as raw data (ICO format contains multiple images)
    wxMemoryFSHandler::AddFile("IDI_ICON.ico", IDI_ICON_data, IDI_ICON_data_size);

    // Initialize memory filesystem handler with all images
    addImageFromMemory("IDB_UNMARKED", IDB_UNMARKED_data, IDB_UNMARKED_data_size, wxBITMAP_TYPE_BMP);
    addImageFromMemory("IDB_MARKED", IDB_MARKED_data, IDB_MARKED_data_size, wxBITMAP_TYPE_BMP);
    addImageFromMemory("IDB_COLD", IDB_COLD_data, IDB_COLD_data_size, wxBITMAP_TYPE_BMP);
    addImageFromMemory("IDB_WARM", IDB_WARM_data, IDB_WARM_data_size, wxBITMAP_TYPE_BMP);
    addImageFromMemory("IDB_HOT", IDB_HOT_data, IDB_HOT_data_size, wxBITMAP_TYPE_BMP);
    addImageFromMemory("IDB_ALMOST", IDB_ALMOST_data, IDB_ALMOST_data_size, wxBITMAP_TYPE_BMP);
    addImageFromMemory("IDB_BIGBUTTON", IDB_BIGBUTTON_data, IDB_BIGBUTTON_data_size, wxBITMAP_TYPE_BMP);
    addImageFromMemory("IDB_CORRECT", IDB_CORRECT_data, IDB_CORRECT_data_size, wxBITMAP_TYPE_BMP);
    addImageFromMemory("IDB_UNUSED", IDB_UNUSED_data, IDB_UNUSED_data_size, wxBITMAP_TYPE_BMP);
    addImageFromMemory("IDB_USED", IDB_USED_data, IDB_USED_data_size, wxBITMAP_TYPE_BMP);
}
